var koa = require("koa");
var app = (module.exports = new koa());
const server = require("http").createServer(app.callback());
const WebSocket = require("ws");
const wss = new WebSocket.Server({ server });
const Router = require("koa-router");
const cors = require("@koa/cors");
const bodyParser = require("koa-bodyparser");

app.use(bodyParser());

app.use(cors());

app.use(middleware);

function middleware(ctx, next) {
  const start = new Date();
  return next().then(() => {
    const ms = new Date() - start;
    console.log(
      `${start.toLocaleTimeString()} ${ctx.response.status} ${
        ctx.request.method
      } ${ctx.request.url} - ${ms}ms`
    );
  });
}

const activities = [
  {
    id: 1,
    date: "2023-02-01",
    type: "Running",
    duration: 30,
    distance: 8000,
    calories: 400,
    rate: 120,
  },
  {
    id: 2,
    date: "2023-02-01",
    type: "Swimming",
    duration: 45,
    distance: 2000,
    calories: 350,
    rate: 115,
  },
  {
    id: 3,
    date: "2023-02-02",
    type: "Cycling",
    duration: 60,
    distance: 30000,
    calories: 500,
    rate: 125,
  },
  {
    id: 4,
    date: "2023-02-03",
    type: "Yoga",
    duration: 75,
    distance: 0,
    calories: 300,
    rate: 110,
  },
  {
    id: 5,
    date: "2023-02-03",
    type: "Weightlifting",
    duration: 45,
    distance: 0,
    calories: 400,
    rate: 115,
  },
  {
    id: 6,
    date: "2023-02-04",
    type: "Running",
    duration: 20,
    distance: 6000,
    calories: 300,
    rate: 130,
  },
  {
    id: 7,
    date: "2023-02-04",
    type: "Cycling",
    duration: 45,
    distance: 25000,
    calories: 450,
    rate: 120,
  },
  {
    id: 8,
    date: "2023-02-05",
    type: "Swimming",
    duration: 30,
    distance: 1500,
    calories: 250,
    rate: 105,
  },
  {
    id: 9,
    date: "2023-02-06",
    type: "Yoga",
    duration: 60,
    distance: 0,
    calories: 200,
    rate: 100,
  },
  {
    id: 10,
    date: "2023-02-07",
    type: "Weightlifting",
    duration: 60,
    distance: 0,
    calories: 500,
    rate: 115,
  },
  {
    id: 11,
    date: "2023-02-08",
    type: "Running",
    duration: 25,
    distance: 7000,
    calories: 350,
    rate: 125,
  },
  {
    id: 12,
    date: "2023-02-09",
    type: "Cycling",
    duration: 75,
    distance: 35000,
    calories: 550,
    rate: 130,
  },
  {
    id: 13,
    date: "2023-02-10",
    type: "Swimming",
    duration: 50,
    distance: 2500,
    calories: 400,
    rate: 120,
  },
  {
    id: 14,
    date: "2023-02-11",
    type: "Yoga",
    duration: 90,
    distance: 0,
    calories: 350,
    rate: 115,
  },
  {
