    distance: 30000,
    calories: 500,
    rate: 130,
  },
  {
    id: 18,
    date: "2023-02-15",
    type: "Swimming",
    duration: 40,
    distance: 2000,
    calories: 350,
    rate: 115,
  },
];

const reservedEntries = []; // Add this at the top of your server file

const router = new Router();

router.get("/reserved", (ctx) => {
  ctx.response.body = reservedEntries;
  ctx.response.status = 200;
});

router.put("/reserve", (ctx) => {
  console.log("Received reserve request"); // Add logging
  console.log("Request body:", ctx.request.body);

  const { entryId } = ctx.request.body;
  console.log("Trying to reserve entry with ID:", entryId);

  const entryToReserve = activities.find((activity) => activity.id === entryId);

  if (entryToReserve) {
    console.log("Entry found, adding to reserved entries");
    reservedEntries.push(entryToReserve);
    ctx.response.body = entryToReserve;
    ctx.response.status = 200;
  } else {
    console.log("Entry not found");
    ctx.response.status = 404;
  }
});

router.get("/dates", (ctx) => {
  const dates = activities.map((activity) => activity.date);
  const uniqueDates = new Set(dates);
  ctx.response.body = [...uniqueDates];
  ctx.response.status = 200;
});

router.get("/entries/:date", (ctx) => {
  // console.log("ctx: " + JSON.stringify(ctx));
  const headers = ctx.params;
  const date = headers.date;
  // console.log("category: " + JSON.stringify(category));
  ctx.response.body = activities.filter((activity) => activity.date == date);
  // console.log("body: " + JSON.stringify(ctx.response.body));
  ctx.response.status = 200;
});

router.get("/all", (ctx) => {
  ctx.response.body = activities;
  ctx.response.status = 200;
});

router.get("/entries", (ctx) => {
  ctx.response.body = activities;
  ctx.response.status = 200;
});

const broadcast = (data) =>
  wss.clients.forEach((client) => {
    if (client.readyState === WebSocket.OPEN) {
      client.send(JSON.stringify(data));
    }
  });

router.post("/entry", (ctx) => {
  // console.log("ctx: " + JSON.stringify(ctx));
  const headers = ctx.request.body;
  // console.log("body: " + JSON.stringify(headers));
  const date = headers.date;
  const type = headers.type;
  const duration = headers.duration;
  const distance = headers.distance;
  const calories = headers.calories;
  const rate = headers.rate;
  if (
    typeof date !== "undefined" &&
    typeof type !== "undefined" &&
    typeof duration !== "undefined" &&
    typeof distance !== "undefined" &&
    typeof calories !== "undefined" &&
    typeof rate !== "undefined"
  ) {
    const index = activities.findIndex(
      (activity) => activity.date == date && activity.type == type
    );
    if (index !== -1) {
      const msg = "Activity already exists!";
      console.log(msg);
      ctx.response.body = { text: msg };
      ctx.response.status = 404;
    } else {
      let maxId =
        Math.max.apply(
          Math,
          activities.map((activity) => activity.id)
        ) + 1;
      let activity = {
        id: maxId,
        date,
        type,
        distance,
        calories,
        duration,
        rate,
      };
      activities.push(activity);
      broadcast(activity);
      ctx.response.body = activity;
      ctx.response.status = 200;
    }
  } else {
    const msg =
      "Missing or invalid date: " +
      date +
      " type: " +
      type +
      " duration: " +
      duration +
      " distance: " +
      distance +
      " calories: " +
      calories +
      " rate: " +
      rate;
    console.log(msg);
    ctx.response.body = { text: msg };
    ctx.response.status = 404;
  }
});

router.del("/entry/:id", (ctx) => {
  // console.log("ctx: " + JSON.stringify(ctx));
  const headers = ctx.params;
  // console.log("body: " + JSON.stringify(headers));
  const id = headers.id;
  if (typeof id !== "undefined") {
    const index = activities.findIndex((activity) => activity.id == id);
    if (index === -1) {
      const msg = "No activity with id: " + id;
      console.log(msg);
      ctx.response.body = { text: msg };
      ctx.response.status = 404;
    } else {
      let activity = activities[index];
      activities.splice(index, 1);
      ctx.response.body = activity;
      ctx.response.status = 200;
    }
  } else {
    ctx.response.body = { text: "Id missing or invalid" };
    ctx.response.status = 404;
  }
});

router.put("/entry/:id", (ctx) => {
  const id = ctx.params.id;
  const updatedData = ctx.request.body; // Get the updated data from the request body

  if (typeof id !== "undefined" && updatedData) {
    const index = activities.findIndex((activity) => activity.id == id);
    if (index === -1) {
      const msg = `No activity found with id: ${id}`;
      console.log(msg);
      ctx.response.body = { text: msg };
      ctx.response.status = 404;
    } else {
      // Update the entry with the new data
      let activity = activities[index];
      activity = { ...activity, ...updatedData }; // Merge the updated data
      activities[index] = activity; // Replace the old entry with the updated one

      console.log(`Updated activity with id: ${id}`);
      ctx.response.body = activity; // Send the updated entry back
      ctx.response.status = 200;
    }
  } else {
    ctx.response.body = { text: "Id missing or invalid, or no data provided" };
    ctx.response.status = 400;
  }
});

app.use(router.routes());
app.use(router.allowedMethods());

const port = 7496;

server.listen(port, () => {
  console.log(`Server listening on ${port} ... `);
});

