      date +
      " type: " +
      type +
      " duration: " +
      duration +
      " distance: " +
      distance +
      " calories: " +
      calories +
      " rate: " +
      rate;
    console.log(msg);
    ctx.response.body = { text: msg };
    ctx.response.status = 404;
  }
});

